  \"2015-08-21T22:35:40.482548\",\n\t\"name\": \"farm-loans-disaster-set-aside-program\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"When Farm Service Agency (FSA) borrowers
  located in designated disaster areas or contiguous (adjoining) counties are unable
  to make their scheduled payment on any FSA debt, FSA is authorized to consider set-aside
  of one payment to allow the operation to continue. This program is authorized under
  Section 331A of the Consolidated Farm and Rural Development Act. Assistance is available
  in counties, or contiguous counties, who have been designated as emergencies by
  the President, Secretary or FSA Administrator.\",\n\t\"license_title\": \"Creative
